  const [checked, setChecked] = useState(true);

  const handleSwitchChange = () => {
    setChecked(!checked);
    console.log(checked);
  };

  return (
    <div>
      <Switch checked={checked} onChange={handleSwitchChange} />
    </div>
  );
};
